import React from "react";
import "./css/sectionBgImg.css";

function SectionWithBgImg(props) {
  return (
    <div className="container-md bg-img-div">
      <h2>{props.heading}</h2>
      <div>{props.text}</div>
    </div>
  );
}

export default SectionWithBgImg;
